def separate_paren_groups(paren_string: str) -> List[str]:
    stack: List[str] = []
    result: List[str] = []
    for char in paren_string:
        if char == "(":
            stack.append(char)
        elif char == ")":
            if len(stack) > 0:
                stack.pop()
            else:
                raise ValueError("Mismatched parentheses")
        elif len(stack) == 0:
            result.append(char)
    if len(stack) != 0:
        raise ValueError("Mismatched parentheses")
    return result

