    same occurrence, return all of them.
    """
    # Split the input string into individual letters
    letters = string.split()

    # Create an empty dictionary to store the counts
    counts = {}

    # Iterate over each letter and increment its count
    for letter in letters:
        if letter not in counts:
            counts[letter] = 1
        else:
            counts[letter] += 1

    # Find the maximum count and return the corresponding letters
    max_count = max(counts.values())
    return {k: v for k, v in counts.items() if v == max_count}

